import {TOGGLE_VIEW,LABEL_ID,DRAWER} from '../Redux/actionType'

export const toggleView = () =>{
    return{
        type:TOGGLE_VIEW
    }
}

export const drawer = () =>{
    return{
        type:DRAWER
    }
}



export const label_id=(labelid)=>{

    console.log(labelid);

    return{
        type:LABEL_ID,
        payload:labelid
    }
}
